import{_ as e}from"./plugin-vue_export-helper-c27b6911.js";import{o,c as r,e as a}from"./app-6af8d918.js";const t={},d=a('<h1 id="场景" tabindex="-1"><a class="header-anchor" href="#场景" aria-hidden="true">#</a> 场景</h1><p>使用<code>koa-router</code> 和<code>koa-multer</code> 存储本地照片报错：<code>Error: Unexpected end of format Multipart._final</code> 改为使用 <code>koa-Router</code> 就没问题啦</p><h1 id="原因" tabindex="-1"><a class="header-anchor" href="#原因" aria-hidden="true">#</a> 原因</h1><p>使用<code>koa-router</code>处理路由时，如果请求中缺少必要的表单数据，就会抛出&quot;Unexpected end of form&quot;错误。<br> 使用 koa-Router 处理请求时，koa-Router 本身并不处理文件上传，并不关心请求中是否包含文件数据。它只负责路由的匹配和处理。因此，当你使用 koa-Router 时，不会出现&quot;Unexpected end of form&quot;错误</p><h1 id="解决" tabindex="-1"><a class="header-anchor" href="#解决" aria-hidden="true">#</a> 解决</h1><p>1、弃坑 koa-router 改为 koa-Router【高效快捷】<br> 2、如果你精力充沛，继续使用 koa-router ，建议查看前端请求的表单数据 、是否合格，调整修改。具体如何修改，我搜了俩小时都没找到解决方案。<br> 如果有大神以第二种方式修改成功，记得留言 v 我呀</p>',6),c=[d];function n(h,u){return o(),r("div",null,c)}const f=e(t,[["render",n],["__file","md028ruhw1kkzydv.html.vue"]]);export{f as default};
